import React from "react";

const Clubs = (props) => {
  const renderMembers = () => {
    return "Listado de miembros";
  };
  return (
    <article>
      <i className={props.icon}> </i>
      <h2>{props.name}</h2>
      <h3> Members;: </h3>
      {renderMembers()}
    </article>
  );
};

export default Clubs;
